import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../assets/styles.css';

function Portfolio({ setModalState }) {  // üîπ Tar emot `setModalState` fr√•n App.jsx
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeModal, setActiveModal] = useState(null);

  useEffect(() => {
    axios.get('https://api.github.com/users/AlexanderG-CA/repos')
      .then(response => {
        setProjects(response.data);
        setLoading(false);
      })
      .catch(error => console.error('Error fetching GitHub projects', error));
  }, []);

  const openModal = (event, projectId) => {
    event.preventDefault();
    event.stopPropagation();
    setActiveModal(projectId);
    setModalState(true);  // üîπ Meddelar App.jsx att modal √§r √∂ppen
  };

  const closeModal = (event) => {
    if (event.target.classList.contains("modal-overlay")) {
      setActiveModal(null);
      setModalState(false);  // üîπ Meddelar App.jsx att modal √§r st√§ngd
    }
  };

  return (
    <div className="portfolio-page">
      {/* Portfolio Header */}
      <header>
        <h1>Portfolio</h1>
      </header>

      {/* Main Content */}
      <main>
        <section className="portfolio">
          {loading ? (
            <p>Laddar projekt...</p>
          ) : (
            projects.map((project) => (
              <div key={project.id} className="project">
                <a 
                  href={project.html_url} 
                  target="_blank" 
                  rel="noopener noreferrer" 
                  className="project-link"
                >
                  <img src={project.owner.avatar_url} alt={project.name} />
                  <h3>{project.name}</h3>
                </a>
                {/* Knapp som √∂ppnar modalen utan att trigga l√§nken */}
                <button className="info-button" onClick={(event) => openModal(event, project.id)}>Mer info</button>

                {/* Modal visas endast om activeModal matchar projektets ID */}
                {activeModal === project.id && (
                  <div className="modal-overlay" onClick={closeModal}>
                    <div className="modal-content" onClick={(e) => e.stopPropagation()}>
                      <span className="close" onClick={() => { setActiveModal(null); setModalState(false); }}>&times;</span>
                      <h2>{project.name}</h2>
                      <p><strong>Beskrivning:</strong> {project.description || 'Det h√§r √§r den f√∂rsta iterationen av denna hemsidan innan dynamiska aspekter tillf√∂rts.'}</p>
                      <p><strong>Skapat:</strong> {project.created_at ? project.created_at.split('T')[0] : 'Ok√§nt'}</p>
                      <p><strong>Senast uppdaterad:</strong> {project.updated_at ? project.updated_at.split('T')[0] : 'Ok√§nt'}</p>
                      <p><strong>Stj√§rnor:</strong> ‚≠ê {project.stargazers_count || 0}</p>
                      <p><strong>Spr√•k:</strong> {project.language || 'Ej angivet'}</p>
                      <a href={project.html_url} target="_blank" rel="noopener noreferrer" className="github-link">
                        Bes√∂k GitHub-repo
                      </a>
                    </div>
                  </div>
                )}
              </div>
            ))
          )}
        </section>
      </main>

      {/* Footer */}
      <footer>
        <p>&copy; 2025 Mitt CV</p>
      </footer>
    </div>
  );
}

export default Portfolio;
